ALTER SESSION SET NLS_DATE_FORMAT='DD/MM/YYYY';
SET LINESIZE 120
SET PAGESIZE 100

CREATE TABLE Customer(
   customer_id       VARCHAR(5)  NOT NULL PRIMARY KEY,
   name              VARCHAR(28) NOT NULL UNIQUE,
   address           VARCHAR(61) NOT NULL,
   gender            VARCHAR(6)  NOT NULL CHECK (UPPER(gender) in ('MALE', 'FEMALE')),
   date_of_birth     DATE        NOT NULL,
   mobile            VARCHAR(12) NOT NULL,
   membership        VARCHAR(10) DEFAULT 'NOT MEMBER' NOT NULL CHECK (UPPER(membership) in ('IS MEMBER', 'NOT MEMBER')),
   email             VARCHAR(36) NOT NULL,
   CONSTRAINT customer_chk_customer_id CHECK (REGEXP_LIKE(customer_id, '^C\d{4}$')),
   CONSTRAINT customer_chk_mobile      CHECK (REGEXP_LIKE(mobile, '^(01[(2-90)]-\d{7})$|^(011-\d{8})$')),
   CONSTRAINT customer_chk_email       CHECK (REGEXP_LIKE(email,'^[a-zA-Z]\w+@(\S+)$'))
);


select count(*) as TotalCustomerRecords from Customer;